  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Lacreek Migratory
  Waterfowl Refuge outlines Refuge accomplishments from August of 1937. The report
  begins by summarizing the water conditions during this period. Wildlife- including
  migratory birds- is also covered. The Refuge development and maintenance section
  discusses physical developments and plantings. Resource management is outlined;
  topics include haying. Photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
